import React from 'react';
import logo from '../assets/cubet-logo.png';
import { motion } from 'framer-motion';
<>
  <div className="bg-white dark:bg-black text-black dark:text-purple-500">
  </div>
  <button
    onClick={() => document.documentElement.classList.toggle('dark')}
    className="absolute top-4 right-4 px-3 py-2 bg-gray-800 text-white rounded"
  >
    Toggle Dark Mode
  </button>
</>

const Header = () => (
  <motion.header
    initial={{opacity: 0, y: -20}}
    animate={{opacity: 1, y: 0}}
    transition={{duration: 0.6}}
    className="bg-black flex items-center p-4"
  >
    <img src={logo} alt="Cubet Logo" className="h-12 mr-4" />
    <h1 className="text-purple-500 text-2xl font-bold">Cubet</h1>
  </motion.header>
  
);
export default Header;
